Desc:
&lt;มาสนุกกับการออกกำลังกายด้วยเกมกันเถอะ!&gt;
ใช้ O-ริงฟิต อุปกรณ์สำหรับออกกำลังกายได้ง่ายและสนุกเองที่บ้านของคุณ
ไม่ว่าจะออกกำลัง ไดเอทหรือแบบไหนก็ใช้ได้หมด!

ของแถมที่ได้รับเมื่อซื้ออัลบั้มวาเลนไทน์ลิมิเต็ดอิดิชั่น
ของแบล็ก เดธ พอยซั่น &lt;ความรักคือการไขว่คว้าพิชิตใจ&gt;
รสชาตินุ่มและหวาน ต่างจากรูปลักษณ์ที่ดูน่ากลัว
